import SavingsCalculator from './SavingsCalculator'; // Import the SavingsCalculator component
import './Home.css'; // Import custom styles for the Home page

const Home = () => {
  return (
    <div className="home">
      <header className="hero">
        <h1>Harness the Power of the Sun with Our Solar Solutions</h1>
        <p>Brief introduction to the company's mission and services</p>
        <button>Get a Quote</button>
      </header>
      <section className="savings-section">
        <SavingsCalculator />
      </section>
      {/* Additional sections like Services, About Us, Projects, and Contact Us */}
    </div>
  );
}

export default Home;
